DROP TABLE IF EXISTS `anmi_user`;
CREATE TABLE `anmi_user` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '用户组建，自增长',
  `username` varchar(20) NOT NULL COMMENT '用户名',
  `status` int(11) unsigned NOT NULL COMMENT '用户状态1，启用；0，禁用；2，删除；',
  `truename` varchar(20) DEFAULT NULL COMMENT '真实姓名',
  `shorthandname` varchar(20) DEFAULT NULL COMMENT '姓名简写，方便模糊查询',
  `password` varchar(128) NOT NULL COMMENT '密码',
  `phone` varchar(11) DEFAULT NULL COMMENT '联系电话',
  `avatarurl` text NOT NULL COMMENT '头像地址',
  `department_id` int(3) DEFAULT NULL COMMENT '部门id索引',
  `company_id` int(3) DEFAULT NULL COMMENT '公司id索引',
  `position_id` int(3) DEFAULT NULL COMMENT '职位ID索引',
  `addtime` int(10) unsigned NOT NULL COMMENT '注册时间',
  `admin_status` int(11) NOT NULL DEFAULT '0' COMMENT '后台管理权限,0=false,1=turn',
  `password_hash` varchar(6) NOT NULL DEFAULT '0' COMMENT '密码加密符',
  `revise_id` int(10) NOT NULL COMMENT '修改资料人员id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='用户表';

