DROP TABLE IF EXISTS `db_commodity`;
CREATE TABLE `db_commodity` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '// 自动编号',
  `uid` char(11) NOT NULL DEFAULT '0' COMMENT '// 开发人  默认为0  0为官方直销',
  `pid` int(11) NOT NULL DEFAULT '0' COMMENT '// 类别id',
  `pid_val` varchar(255) DEFAULT NULL COMMENT '分类属性值',
  `attribute` text COMMENT '商品属性',
  `title` varchar(255) DEFAULT NULL COMMENT '// 商品标题',
  `picture` char(50) DEFAULT NULL COMMENT '// 封面图',
  `market_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '// 市场价',
  `member_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '// 会员价',
  `cost_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '// 成本价',
  `intro` varchar(255) DEFAULT NULL COMMENT '// 商品简介',
  `content` text COMMENT '// 商品详情',
  `remand` int(1) DEFAULT '0' COMMENT '是否推荐  0 ：未推荐  1：已推荐',
  `freight` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '// 运费  0为免费配送',
  `stock` int(11) DEFAULT '0' COMMENT '库存',
  `shelves` int(2) DEFAULT '0' COMMENT '是否上架',
  `sale_volume` int(11) DEFAULT '0' COMMENT '销量',
  `hit` int(11) NOT NULL DEFAULT '0' COMMENT '// 销量',
  `popularity` int(11) NOT NULL DEFAULT '0' COMMENT '// 人气(查看次数)',
  `create_time` int(10) NOT NULL DEFAULT '0' COMMENT '// 创建时间',
  `update_time` int(10) NOT NULL DEFAULT '0' COMMENT '// 更新时间',
  `sort` int(11) NOT NULL DEFAULT '0' COMMENT '// 排序',
  `status` int(1) NOT NULL DEFAULT '0' COMMENT '// 状态 0为可用 1为不可用',
  `is_delete` int(1) NOT NULL DEFAULT '0' COMMENT '// 回收站 0为未删除 1为伪删除',
  `web_title` char(200) DEFAULT NULL COMMENT '// 网站标题',
  `web_keywords` text COMMENT '// 网站关键字',
  `web_description` text COMMENT '// 网站描述',
  `birth_time` int(10) NOT NULL DEFAULT '0' COMMENT '// 上市时间，用作前台商品新品排序',
  PRIMARY KEY (`id`),
  KEY `pid` (`pid`),
  KEY `uid` (`uid`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=218 DEFAULT CHARSET=utf8 COMMENT='商品表';

