  `upgrade_consumer` char(50) DEFAULT NULL COMMENT '// 消费商升级规则',
  `upgrade_micro` char(255) DEFAULT NULL COMMENT 'json存放的团推直推升级规则',
  `reward_consume` int(11) NOT NULL DEFAULT '0' COMMENT '// 个人消费奖励',
  `reward_partner` int(11) NOT NULL DEFAULT '0' COMMENT '// 合伙人奖励[产品推荐人，也就是第三方产品]',
  `reward_recommend` varchar(255) DEFAULT NULL COMMENT '// 推荐奖励[共8层]',
  `reward_team` varchar(255) DEFAULT NULL COMMENT '// 团队管理奖励',
  `postal_number` int(2) DEFAULT '1' COMMENT '每日提现次数',
  `postal_low_price` float(11,2) DEFAULT '0.00' COMMENT '每次提现最低金额',
  `postal_high_price` float(11,2) DEFAULT '0.00' COMMENT '每次提现最高金额',
  `is_postal_check` int(1) DEFAULT '0' COMMENT '是否开启提现审核',
  `update_time` int(10) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='网站基本信息表';

