-- ----------------------------
-- Table structure for `db_member`
-- ----------------------------
DROP TABLE IF EXISTS `db_member`;
CREATE TABLE `db_member` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '用户id，主键',
  `username` char(11) DEFAULT NULL COMMENT '// 用户名',
  `nickname` char(20) DEFAULT NULL COMMENT '// 姓名',
  `password` char(40) DEFAULT NULL COMMENT '// 密码',
  `integral` float(11,1) NOT NULL DEFAULT '0.0' COMMENT '// 总积分',
  `grown` float(11,1) DEFAULT '0.0' COMMENT '成长值',
  `money` float(11,2) DEFAULT '0.00' COMMENT '钱包',
  `use_money` float(11,2) DEFAULT '0.00',
  `money_pass` varchar(11) DEFAULT NULL COMMENT '钱包密码',
  `reward` float(11,2) DEFAULT '0.00' COMMENT '剩余奖励  可以提现的奖励',
  `use_reward` float(11,0) DEFAULT '0' COMMENT '已使用的奖励',
  `use_integral` int(11) NOT NULL DEFAULT '0' COMMENT '// 已使用的积分',
  `first_view` tinyint(1) NOT NULL DEFAULT '0' COMMENT '// 是否访问过系统 0为未访问过 1为已访问过',
  `level` int(10) NOT NULL DEFAULT '0' COMMENT '// 会员等级',
  `wx_open_id` varchar(255) DEFAULT NULL COMMENT '// 微信Open_Id',
  `wx_name` varchar(255) DEFAULT NULL COMMENT '// 微信名称',
  `bank_type` varchar(255) DEFAULT NULL COMMENT '// 银行类别',
  `bank_id` varchar(255) DEFAULT NULL COMMENT '// 银行账号',
  `bank_name` varchar(255) DEFAULT NULL COMMENT '// 银行户名',
  `bank_hang` varchar(255) DEFAULT NULL COMMENT '// 银行开户行',
  `face` char(50) DEFAULT NULL COMMENT '// 会员头像',
  `idcard` char(18) DEFAULT NULL COMMENT '// 身份证号码',
  `sex` tinyint(1) NOT NULL DEFAULT '0' COMMENT '// 性别 0为未知  1为男 2为女',
  `tel` char(20) DEFAULT NULL COMMENT '// 手机号码',
  `email` char(30) DEFAULT NULL COMMENT '// 邮箱',
  `qq` int(10) DEFAULT NULL COMMENT '// qq号码',
  `phone` char(15) DEFAULT NULL COMMENT '// 座机号码',
  `address` varchar(255) DEFAULT NULL COMMENT '// 联系地址',
  `province` int(10) NOT NULL DEFAULT '0' COMMENT '// 省',
  `city` int(10) NOT NULL DEFAULT '0' COMMENT '// 市',
  `area` int(10) NOT NULL DEFAULT '0' COMMENT '// 县',
  `unit` varchar(255) DEFAULT NULL COMMENT '// 单位',
  `position` varchar(255) DEFAULT NULL COMMENT '// 职位',
  `create_time` int(10) NOT NULL DEFAULT '0' COMMENT '// 创建时间',
  `update_time` int(10) NOT NULL DEFAULT '0' COMMENT '// 更新时间',
  `last_login_time` int(10) NOT NULL DEFAULT '0' COMMENT '// 最后一次登录的时间',
  `last_login_ip` int(11) DEFAULT '0' COMMENT '// 最后一次登录的IP',
  `birthday` int(10) NOT NULL DEFAULT '0' COMMENT '// 生日',
  `auth` int(11) NOT NULL DEFAULT '0' COMMENT '1一级2二级3三级4抄送5人力0普通',
  `verify` tinyint(1) NOT NULL DEFAULT '0' COMMENT '// 0 未审核 1已审核',
  `range_time` smallint(4) DEFAULT '0' COMMENT '审批时间范围',
  `sort` int(10) NOT NULL DEFAULT '0' COMMENT '// 排序',
  `status` tinyint(3) NOT NULL DEFAULT '1' COMMENT '状态0 已启用  1 未启用',
  `is_delete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否删除 0表示存在 1表示软删除,默认为0',
  `cid` int(10) DEFAULT NULL COMMENT '//所属单位编号',
  `department_id` int(10) DEFAULT NULL COMMENT '//部门检索id',
  `position_id` int(10) DEFAULT NULL COMMENT '//职位检索id',
  `personal_code` varchar(50) DEFAULT NULL COMMENT '//个人代号',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`) USING BTREE,
  UNIQUE KEY `username` (`username`) USING BTREE,
  UNIQUE KEY `wx_open_id` (`wx_open_id`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=166 DEFAULT CHARSET=utf8 COMMENT='会员表';

