-- ----------------------------
-- Procedure structure for `getChildId`
-- ----------------------------
DROP PROCEDURE IF EXISTS `getChildId`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `getChildId`(rootId INT)
    COMMENT '根据父类ID 获取当前父类ID下的所有子类ID'
BEGIN
	DECLARE sTemp VARCHAR (1000);
	/*定义一个临时字段来存放所有的类别与子类别*/
	DECLARE sTempChd VARCHAR (1000);
	/*定义一个临时字段，来得到当前类别的子类别*/
	SET sTemp = '';
	SET sTempChd = CAST(rootId AS CHAR);
	
	WHILE sTempChd IS NOT NULL DO
		SET sTemp = CONCAT(sTemp, ',', sTempChd);
		/*将以前类别与现在查询类别进行合并*/
		/*将每次查到的子id形成一个字符组，放到sTempChd里，如果sTempChd为null就停止循环*/
		SELECT GROUP_CONCAT(id) INTO sTempChd FROM db_commodity_class WHERE FIND_IN_SET(pid, sTempChd) > 0;
	END WHILE;
	SET sTemp = SUBSTRING(sTemp, 2, CHAR_LENGTH(sTemp));
	SELECT sTemp as child_id_list;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `getChildList`
-- ----------------------------
DROP PROCEDURE IF EXISTS `getChildList`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `getChildList`(rootId INT,limits INT)
    COMMENT '根据父类ID 获取当前父类ID下的所有子类ID 并查询商品'
BEGIN
	DECLARE sTemp VARCHAR (1000);
	/*定义一个临时字段来存放所有的类别与子类别*/
	DECLARE sTempChd VARCHAR (1000);
	/*定义一个临时字段，来得到当前类别的子类别*/
	SET sTemp = '';
	SET sTempChd = CAST(rootId AS CHAR);
	
	WHILE sTempChd IS NOT NULL DO
		SET sTemp = CONCAT(sTemp, ',', sTempChd);
		/*将以前类别与现在查询类别进行合并*/
		/*将每次查到的子id形成一个字符组，放到sTempChd里，如果sTempChd为null就停止循环*/
		SELECT GROUP_CONCAT(id) INTO sTempChd FROM db_commodity_class WHERE FIND_IN_SET(pid, sTempChd) > 0;
	END WHILE;
	SET sTemp = SUBSTRING(sTemp, 2, CHAR_LENGTH(sTemp));
	SELECT id,title,picture FROM db_commodity WHERE FIND_IN_SET(pid,sTemp) LIMIT limits;
END
;;
DELIMITER ;
