INSERT INTO `db_article` VALUES ('5', '16', '华为Mate 20 发布，支持无线反向充电', 'Uploads/public/2018-10-18/5bc86e9ff3df1.jpg', null, '<p style=\"margin-top: 26px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">崔玉贤/文</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">一个月前苹果2018年秋季发布会刚结束，华为消费者业务CEO余承东就在社交软件上发文：稳了，我们十月十六日伦敦见。一个月后，英国伦敦，华为发布Mate20系列新品，在以往系列的基础上增加了“X”系列，并将超广角、超微距、双向无线快充、3D结构光、屏下指纹、石墨烯等黑科技集于一身。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">外界直呼：难怪老余说“稳了”。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">“冒险”设计：浴霸摄像头引争议？</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">9月13日，苹果2018年秋季发布会刚结束，余承东就在社交软件上发文：稳了，我们十月十六日伦敦见。这句“稳了”也被当时各大媒体所引用，苹果铺天盖地占满所有媒体的头条同时，华为也因为这句“稳了”无限风光。这句“稳了”被认为是国产手机厂商多年来“跟随”苹果的转折：国产手机厂商也有了自己的创新，有了自己的自信。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">在这句“稳了”之后，华为在中国展开了有步骤的“谍照曝光”，华为Mate20系列新品的宣传节奏整整提前了一个月。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">北京时间9月16日晚上，华为Mate20系列在伦敦最终揭晓，全场发布会不时传来掌声，是给余承东的幽默，也是给华为Mate20系列新品的肯定。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">此次，华为照例发布了Mate20系列的三款升级产品：Mate20、Mate20 Pro、Mate 20 RS保时捷设计。在大家都以为要结束的时候，余承东又公布了一个“One More Big Thing”：华为Mate20 X，7.2英寸的大屏幕。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">华为Mate20系列不出意外的搭载了麒麟980芯片，这个被华为称之为全球首个7nm工艺的AI芯片，拥有8个全球首次。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">这次，华为Mate20系列将拍照功能进行了大幅度升级：摄像头大胆采用了四点设计，矩阵多焦设计：在一个机器上实现了长焦、广角、超广角这三类摄像师最常用的镜头，再加上了闪光灯。在指甲盖大小的地方放入了4个关键器件。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">此前，华为Mate20谍照曝光时，摄像头与闪光灯形成的两两对称，居中设计也是备受争议。外界还因此给取名为“浴霸式”设计。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">据了解，“浴霸式”的摄像头的设计灵感来自于保时捷的“四点式车灯”设计。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">“这个四点式设计不是来自保时捷的普通车型，而是顶级车型中。我们没有担心会受到外界的质疑。”在产品体验环节，余承东向网易科技表示。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">华为设计总监Joonsuh Kim也是表示，虽然一开始收到一些比较消息的反应，但华为相信随着时间的推移，越来越多的人会喜欢这个设计。“我们相信这款产品发布之后，会有更多公司跟随我们。华为制造的理念就是要加入更多尖端的科技，不随波逐流，不想同质化。我们要走自己的路。”Joonsuh Kim表示。</span></p><p><img class=\"large\" data-loadfunc=\"0\" src=\"https://ss1.baidu.com/6ONXsjip0QIZ8tyhnq/it/u=276103795,2434228691&fm=173&app=25&f=JPG?w=550&h=297&s=3FB10B8E87400D5FF0432F8103007088\" data-loaded=\"0\" style=\"border: 0px; width: 537px; display: block;\"/></p><p style=\"margin-top: 26px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">摩擦苹果拍照功能引领行业</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">如果说”浴霸式”设计会让很多用户感到困惑的话，理解其背后设计的原理或许让你对这份设计多一份理解。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">据了解，华为Mate20系类矩阵多焦摄像系统之所以采用浴霸式设计，就是为了让超广角镜头、长焦镜头、广角镜头与闪光灯更有效的排列组合，并让手机更薄。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">Mate20系列摄像头的两大特色：超广角镜头和微距进行了较大提升。微距效果，最近可实现2.5厘米对焦距离，Mate 20 Pro配备4000万像素的广角镜头，2000万像素的超广角镜头，800万像素的长焦镜头的影像系统，从而可以实现从等效焦距16mm-270mm的专业拍摄效果。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">在发布会上，余承东不免又将Mate20系列的拍摄样张与iPhone XS Max以及三星Galaxy Note9进行对比。看着这一组组对比，旁边有媒体朋友感慨：华为的拍照将苹果狠狠的摩擦（碾压的意思）。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">在会后采访环节，华为产品经理李小龙也表示，华为Mate20系列在拍照上的大幅提升就是要将“影像第一的帽子永远戴下去。”</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">众所周知，从2016年华为P9，开始与徕卡合作，研发了徕卡双镜头拍照系统；华为P20 Pro全球首款徕卡三摄，直到苹果iPhone XS Max发布之后，华为P20 Pro仍以109分的成绩占据DxOMark榜首的位置，iPhone XS Max则以105分的成绩排名第二。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">此次，华为Mate20系列将拍照功能再次进行了革命性的提升，相信DxOMark榜单将再次更新。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">双向无线快充华为又diss了苹果</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">大电池、超续航一直是华为Mate系列的最大特色。华为Mate20系列在续航能力又进一步的突破：华为Mate 20 Pro升级到4200mAh（TYP）高密度大容量电池，并首次搭载40W华为超级快充技术，30分钟充电约70%。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">除此之外，华为Mate 20 Pro支持15W无线快充技术，可以说是现阶段业界最快的无线充电速率。同时突破性地支持无线反向充电技术，可为其它部分无线充电产品进行充电。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">“无线反向充电技术就很好，这样华为手机就可以给华为的周边智能硬件产品进行充电，对用户来说省掉了忘拿充电线的烦恼。”媒体朋友感慨道。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">在发布会上，余承东也开玩笑的表示，华为的Mate20系列无线反充技术可以给苹果iPhone X/XS进行充电。华为再次狠狠的diss了苹果。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">不仅如此，此次发布会华为还在原有的Mate产品线基础上，增加了Mate20X：7.2英寸的大屏幕；5000mAh大电池。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">华为产品线总裁何刚表示，之所以推出Mate20X系列是为了将Mate的“超大屏、超续航、超大电池”的特色发挥到极致。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">除此之外，Mate20X还采用了石墨烯+液冷散热系统组合的散热系统，这也是石墨烯技术自问世以来首次在智能手机上得到应用。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">多种黑科技集一身华为打下关键一役</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">除了上述所提到的黑科技，华为Mate20系列还融入了3D结构光人脸识别、屏幕指纹识别、AI人像留色、5倍长焦光变等等。可以说是集众多黑科技于一身。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">作为华为年度高端旗舰机，加载更多黑科技是常理，但突然之间加入如此之多的黑科技，实为少见。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">在今年第二季度，华为首次单季度超越苹果之后，华为超越苹果和三星的步伐似乎在加快。在2018年上半年业绩沟通会上，余承东再次霸气的表示：“我的团队无论做什么领域，都要成为该领域的王者。”</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">华为到了厚积薄发的时候。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">所谓的厚积薄发是华为持续在研发创新方面的投入。2017年度，中国企业研发投入前15强中，华为以103.63亿欧元的研发投入名列榜首。创始人任正非撰文“为祖国百年科技振兴而努力奋斗”中透露，华为每年的研发投入中，70%用于产品开发，20%~30%用于研究和创新，且未来几年华为的研发投入要保持在100~200亿美元之间。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">仅仅一个季度超越苹果显然不能满足余承东的野心，他希望华为成为全球第一，而且全球市场份额要占到30%以上。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">华为Mate20系列的大革新，可以说是打下了坚实的一役。</span></p><p><br/></p>', '0', '0', null, '1539862182', null, '0', null, '0', null, null, null, '8');
INSERT INTO `db_article` VALUES ('6', '16', '龙芯派二代发布：搭载双核CPU 40nm工艺打造', 'Uploads/public/2018-10-18/5bc8880dd9b31.jpg', null, '<p style=\"margin-top: 20px; margin-bottom: 20px; padding: 0px; height: auto; overflow: visible; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 30px; font-family: &quot;Microsoft Yahei&quot;; word-break: break-all; white-space: normal; background-color: rgb(255, 255, 255);\"><strong>【PConline 资讯】</strong>10月17日，龙芯中科宣布推出龙芯派二代开发平台，整个都是纯国产。</p><p style=\"margin-top: 20px; margin-bottom: 20px; padding: 0px; height: auto; overflow: visible; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 30px; font-family: &quot;Microsoft Yahei&quot;; word-break: break-all; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><span class=\"cmt-img-editor-el\" style=\"font-size: 0px; line-height: 0; position: relative; display: inline-block; vertical-align: top;\"><a href=\"https://www.pconline.com.cn/images/html/viewpic_pconline.htm?//img0.pconline.com.cn/pconline/1810/17/11847417_jh.jpg&channel=309\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\"><img alt=\"1\" class=\"art-pic-for-cmt\" data-height=\"565\" data-width=\"700\" src=\"/ueditor/php/upload/image/20181018/1539868656978539.jpg\" title=\"1\" style=\"border: 1px solid rgb(204, 204, 204); vertical-align: top; transition: opacity 0.2s; max-width: 700px;\"/></a><button class=\"cmt-img-editor-bt\" data-event=\"showImgBt\" data-data=\"{i:0,target:&#39;cmt_img_b70ggfgtb8&#39;}\" style=\"margin: 0px; padding: 0px; transition: all 0.4s cubic-bezier(1, 0.03, 0.26, 1.43); display: block; position: absolute; bottom: 10px; right: 10px; border-width: 0px; border-style: initial; border-color: initial; font-size: 0px; line-height: 0; width: 86px; height: 27px; opacity: 0; cursor: pointer; background-repeat: no-repeat; outline: none; background-position: 0px -1117px; background-image: url(&quot;//www1.pconline.com.cn/test/cxk/static/images/icons.png&quot;);\"></button></span></p><p style=\"margin-top: 20px; margin-bottom: 20px; padding: 0px; height: auto; overflow: visible; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 30px; font-family: &quot;Microsoft Yahei&quot;; word-break: break-all; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><span class=\"js2-16 js2-16Ext\" data-ver=\"v2\" productid=\"1041430\" style=\"width: 700px; padding: 0px; margin: -20px auto 0px; border-width: 0px 1px 1px; border-right-style: solid; border-bottom-style: solid; border-left-style: solid; border-right-color: rgb(204, 204, 204); border-bottom-color: rgb(204, 204, 204); border-left-color: rgb(204, 204, 204); border-image: initial; border-top-style: initial; border-top-color: initial; display: block;\"><span class=\"js2-proName\" style=\"height: 42px; line-height: 42px; overflow: hidden; text-align: left; display: block; padding: 0px 10px; border-bottom: 1px solid rgb(204, 204, 204);\"><a href=\"https://product.pconline.com.cn/cpu/intel/1041430.html\" target=\"_blank\" title=\"Intel 酷睿i7 8700K\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\">Intel 酷睿i7 8700K</a></span><span class=\"js2-dsList\" style=\"overflow: hidden; display: table; vertical-align: middle; font-size: 14px;\"><span class=\"js2-dt\" style=\"width: 115px; display: table-cell; vertical-align: middle;\">电商价格</span><span class=\"js2-dd\" style=\"overflow: hidden; vertical-align: top; width: 587px; line-height: 40px; background-image: url(&quot;//www1.pconline.com.cn/2017/art/images/js2_line.png&quot;); background-position: 0px 41px; background-size: initial; background-repeat: repeat-x; background-attachment: initial; background-origin: initial; background-clip: initial; display: block; border-left: 1px solid rgb(204, 204, 204);\"><span class=\"js2-item\" style=\"width: 195.469px; float: left;\"><a href=\"https://priceparity.pconline.com.cn/load.jsp?pmid=ee0e37b282875e7ec6586e2e9c1cfd54#ad=9959\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\"><img src=\"/ueditor/php/upload/image/20181018/1539868656283890.png\" style=\"border: none; vertical-align: middle; transition: opacity 0.2s; max-width: 700px;\"/>&nbsp;苏宁易购：<span class=\"js2-price\" style=\"color: rgb(254, 50, 51);\">￥3299</span></a></span><span class=\"js2-item\" style=\"width: 195.469px; float: left;\"><a href=\"https://priceparity.pconline.com.cn/load.jsp?pmid=19834942f1192db65ad7d462e727e628#ad=9957\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\"><img src=\"/ueditor/php/upload/image/20181018/1539868657807699.png\" style=\"border: none; vertical-align: middle; transition: opacity 0.2s; max-width: 700px;\"/>&nbsp;京东商城：<span class=\"js2-price\" style=\"color: rgb(254, 50, 51);\">￥2999</span></a></span><span class=\"js2-item\" style=\"width: 195.469px; float: left;\"><a href=\"https://priceparity.pconline.com.cn/load.jsp?pmid=894e9f972a1ce02ebfa6c63c5ab7d8d0#ad=9961\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\"><img src=\"/ueditor/php/upload/image/20181018/1539868657594417.png\" style=\"border: none; vertical-align: middle; transition: opacity 0.2s; max-width: 700px;\"/>&nbsp;国美：<span class=\"js2-price\" style=\"color: rgb(254, 50, 51);\">￥2788</span></a></span></span></span></span></p><p style=\"margin-top: 20px; margin-bottom: 20px; padding: 0px; height: auto; overflow: visible; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 30px; font-family: &quot;Microsoft Yahei&quot;; word-break: break-all; white-space: normal; background-color: rgb(255, 255, 255);\">　　龙芯派二代搭载了主频1.0GHz的龙芯2K1000，64位双核双发射超标量乱序执行架构<span style=\"background-color: rgba(255, 255, 255, 0.65); font-family: &quot;Classic Grotesque W01&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, STHeiti, &quot;WenQuanYi Micro Hei&quot;, Arial, SimSun, sans-serif; text-indent: 32px;\">，</span>支持2D/3D图像处理器，最大功耗5W，峰值运算速度8GFlpos，制造工艺为40nm。同时整个平台使用的是nano-ITX迷你板型，尺寸仅有12×12厘米，这也是二代对比一代最大的区别。</p><p style=\"margin-top: 20px; margin-bottom: 20px; padding: 0px; height: auto; overflow: visible; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 30px; font-family: &quot;Microsoft Yahei&quot;; word-break: break-all; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><span class=\"cmt-img-editor-el\" style=\"font-size: 0px; line-height: 0; position: relative; display: inline-block; vertical-align: top;\"><a href=\"https://www.pconline.com.cn/images/html/viewpic_pconline.htm?//img0.pconline.com.cn/pconline/1810/17/11847417_5e020a8f77aaabb.jpg&channel=309\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\"><img alt=\"1\" class=\"art-pic-for-cmt\" data-height=\"1340\" data-width=\"600\" src=\"/ueditor/php/upload/image/20181018/1539868657639609.jpg\" title=\"1\" style=\"border: 1px solid rgb(204, 204, 204); vertical-align: top; transition: opacity 0.2s; max-width: 700px; height: 1563px; width: 700px;\"/></a><button class=\"cmt-img-editor-bt\" data-event=\"showImgBt\" data-data=\"{i:1,target:&#39;cmt_img_b70ggfgtb8&#39;}\" style=\"margin: 0px; padding: 0px; transition: all 0.4s cubic-bezier(1, 0.03, 0.26, 1.43); display: block; position: absolute; bottom: 10px; right: 10px; border-width: 0px; border-style: initial; border-color: initial; font-size: 0px; line-height: 0; width: 86px; height: 27px; opacity: 0; cursor: pointer; background-repeat: no-repeat; outline: none; background-position: 0px -1117px; background-image: url(&quot;//www1.pconline.com.cn/test/cxk/static/images/icons.png&quot;);\"></button></span></p><p style=\"margin-top: 20px; margin-bottom: 20px; padding: 0px; height: auto; overflow: visible; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 30px; font-family: &quot;Microsoft Yahei&quot;; word-break: break-all; white-space: normal; background-color: rgb(255, 255, 255);\">　　同时龙芯派二代还支持M2的和SSD硬盘，电源也由原来的5V3A microUSB电源换成了现在的12V3A圆柱电源。</p><p style=\"margin-top: 20px; margin-bottom: 20px; padding: 0px; height: auto; overflow: visible; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 30px; font-family: &quot;Microsoft Yahei&quot;; word-break: break-all; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><span class=\"cmt-img-editor-el\" style=\"font-size: 0px; line-height: 0; position: relative; display: inline-block; vertical-align: top;\"><a href=\"https://www.pconline.com.cn/images/html/viewpic_pconline.htm?//img0.pconline.com.cn/pconline/1810/17/11847417_e9b3f57fa46dd9b.jpg&channel=309\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\"><img alt=\"1\" class=\"art-pic-for-cmt\" data-height=\"633\" data-width=\"600\" src=\"/ueditor/php/upload/image/20181018/1539868658545557.jpg\" title=\"1\" style=\"border: 1px solid rgb(204, 204, 204); vertical-align: top; transition: opacity 0.2s; max-width: 700px; height: 739px; width: 700px;\"/></a><button class=\"cmt-img-editor-bt\" data-event=\"showImgBt\" data-data=\"{i:2,target:&#39;cmt_img_b70ggfgtb8&#39;}\" style=\"margin: 0px; padding: 0px; transition: all 0.4s cubic-bezier(1, 0.03, 0.26, 1.43); display: block; position: absolute; bottom: 10px; right: 10px; border-width: 0px; border-style: initial; border-color: initial; font-size: 0px; line-height: 0; width: 86px; height: 27px; opacity: 0; cursor: pointer; background-repeat: no-repeat; outline: none; background-position: 0px -1117px; background-image: url(&quot;//www1.pconline.com.cn/test/cxk/static/images/icons.png&quot;);\"></button></span></p><p style=\"margin-top: 20px; margin-bottom: 20px; padding: 0px; height: auto; overflow: visible; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 30px; font-family: &quot;Microsoft Yahei&quot;; word-break: break-all; white-space: normal; background-color: rgb(255, 255, 255);\">　　软件方面支持Linux、RTOS和主流国产操作系统，同时BIOS、内核、系统源代码全部开源，配套<a data-link=\"1\" href=\"https://c.duomai.com/track.php?k=iRyUSQzUycwRHdo1Ddm0DZpVXZmkDN2ITPklWYmYDO5IDNy0DZp9VZ0l2cmUmchdHdm92cGJTJjZkMl42Yu02bj5SZy9GdzRnZvN3byNWat5yd3dnRyU\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\">教程</a>、工具都可以通过官方FTP下载。</p><p style=\"margin-top: 20px; margin-bottom: 20px; padding: 0px; height: auto; overflow: visible; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 30px; font-family: &quot;Microsoft Yahei&quot;; word-break: break-all; white-space: normal; background-color: rgb(255, 255, 255);\">　　价格方面标准套餐为1399元，探索套装，增加EJTAG仿真器，价格1900元。</p><p><br/></p>', '0', '0', null, '1539868690', null, '0', null, '0', null, null, null, '8');
INSERT INTO `db_article` VALUES ('7', '15', '晚上开会通知', null, null, '<p>定于晚上８点开会</p>', '0', '0', null, '1539868741', null, '0', null, '0', null, null, null, '8');
INSERT INTO `db_article` VALUES ('8', '17', '关于系统升级维护系统升级维护系统升级维护的公告', null, null, '<p style=\"margin-top: 26px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">崔玉贤/文</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">一个月前苹果2018年秋季发布会刚结束，华为消费者业务CEO余承东就在社交软件上发文：稳了，我们十月十六日伦敦见。一个月后，英国伦敦，华为发布Mate20系列新品，在以往系列的基础上增加了“X”系列，并将超广角、超微距、双向无线快充、3D结构光、屏下指纹、石墨烯等黑科技集于一身。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">外界直呼：难怪老余说“稳了”。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">“冒险”设计：浴霸摄像头引争议？</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">9月13日，苹果2018年秋季发布会刚结束，余承东就在社交软件上发文：稳了，我们十月十六日伦敦见。这句“稳了”也被当时各大媒体所引用，苹果铺天盖地占满所有媒体的头条同时，华为也因为这句“稳了”无限风光。这句“稳了”被认为是国产手机厂商多年来“跟随”苹果的转折：国产手机厂商也有了自己的创新，有了自己的自信。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">在这句“稳了”之后，华为在中国展开了有步骤的“谍照曝光”，华为Mate20系列新品的宣传节奏整整提前了一个月。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">北京时间9月16日晚上，华为Mate20系列在伦敦最终揭晓，全场发布会不时传来掌声，是给余承东的幽默，也是给华为Mate20系列新品的肯定。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">此次，华为照例发布了Mate20系列的三款升级产品：Mate20、Mate20 Pro、Mate 20 RS保时捷设计。在大家都以为要结束的时候，余承东又公布了一个“One More Big Thing”：华为Mate20 X，7.2英寸的大屏幕。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">华为Mate20系列不出意外的搭载了麒麟980芯片，这个被华为称之为全球首个7nm工艺的AI芯片，拥有8个全球首次。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">这次，华为Mate20系列将拍照功能进行了大幅度升级：摄像头大胆采用了四点设计，矩阵多焦设计：在一个机器上实现了长焦、广角、超广角这三类摄像师最常用的镜头，再加上了闪光灯。在指甲盖大小的地方放入了4个关键器件。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">此前，华为Mate20谍照曝光时，摄像头与闪光灯形成的两两对称，居中设计也是备受争议。外界还因此给取名为“浴霸式”设计。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">据了解，“浴霸式”的摄像头的设计灵感来自于保时捷的“四点式车灯”设计。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">“这个四点式设计不是来自保时捷的普通车型，而是顶级车型中。我们没有担心会受到外界的质疑。”在产品体验环节，余承东向网易科技表示。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">华为设计总监Joonsuh Kim也是表示，虽然一开始收到一些比较消息的反应，但华为相信随着时间的推移，越来越多的人会喜欢这个设计。“我们相信这款产品发布之后，会有更多公司跟随我们。华为制造的理念就是要加入更多尖端的科技，不随波逐流，不想同质化。我们要走自己的路。”Joonsuh Kim表示。</span></p><p style=\"white-space: normal;\"><img class=\"large\" data-loadfunc=\"0\" src=\"https://ss1.baidu.com/6ONXsjip0QIZ8tyhnq/it/u=276103795,2434228691&fm=173&app=25&f=JPG?w=550&h=297&s=3FB10B8E87400D5FF0432F8103007088\" data-loaded=\"0\" style=\"border: 0px; width: 537px; display: block;\"/></p><p style=\"margin-top: 26px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">摩擦苹果拍照功能引领行业</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">如果说”浴霸式”设计会让很多用户感到困惑的话，理解其背后设计的原理或许让你对这份设计多一份理解。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">据了解，华为Mate20系类矩阵多焦摄像系统之所以采用浴霸式设计，就是为了让超广角镜头、长焦镜头、广角镜头与闪光灯更有效的排列组合，并让手机更薄。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">Mate20系列摄像头的两大特色：超广角镜头和微距进行了较大提升。微距效果，最近可实现2.5厘米对焦距离，Mate 20 Pro配备4000万像素的广角镜头，2000万像素的超广角镜头，800万像素的长焦镜头的影像系统，从而可以实现从等效焦距16mm-270mm的专业拍摄效果。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">在发布会上，余承东不免又将Mate20系列的拍摄样张与iPhone XS Max以及三星Galaxy Note9进行对比。看着这一组组对比，旁边有媒体朋友感慨：华为的拍照将苹果狠狠的摩擦（碾压的意思）。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">在会后采访环节，华为产品经理李小龙也表示，华为Mate20系列在拍照上的大幅提升就是要将“影像第一的帽子永远戴下去。”</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">众所周知，从2016年华为P9，开始与徕卡合作，研发了徕卡双镜头拍照系统；华为P20 Pro全球首款徕卡三摄，直到苹果iPhone XS Max发布之后，华为P20 Pro仍以109分的成绩占据DxOMark榜首的位置，iPhone XS Max则以105分的成绩排名第二。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">此次，华为Mate20系列将拍照功能再次进行了革命性的提升，相信DxOMark榜单将再次更新。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">双向无线快充华为又diss了苹果</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">大电池、超续航一直是华为Mate系列的最大特色。华为Mate20系列在续航能力又进一步的突破：华为Mate 20 Pro升级到4200mAh（TYP）高密度大容量电池，并首次搭载40W华为超级快充技术，30分钟充电约70%。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">除此之外，华为Mate 20 Pro支持15W无线快充技术，可以说是现阶段业界最快的无线充电速率。同时突破性地支持无线反向充电技术，可为其它部分无线充电产品进行充电。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">“无线反向充电技术就很好，这样华为手机就可以给华为的周边智能硬件产品进行充电，对用户来说省掉了忘拿充电线的烦恼。”媒体朋友感慨道。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">在发布会上，余承东也开玩笑的表示，华为的Mate20系列无线反充技术可以给苹果iPhone X/XS进行充电。华为再次狠狠的diss了苹果。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">不仅如此，此次发布会华为还在原有的Mate产品线基础上，增加了Mate20X：7.2英寸的大屏幕；5000mAh大电池。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">华为产品线总裁何刚表示，之所以推出Mate20X系列是为了将Mate的“超大屏、超续航、超大电池”的特色发挥到极致。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">除此之外，Mate20X还采用了石墨烯+液冷散热系统组合的散热系统，这也是石墨烯技术自问世以来首次在智能手机上得到应用。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">多种黑科技集一身华为打下关键一役</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">除了上述所提到的黑科技，华为Mate20系列还融入了3D结构光人脸识别、屏幕指纹识别、AI人像留色、5倍长焦光变等等。可以说是集众多黑科技于一身。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">作为华为年度高端旗舰机，加载更多黑科技是常理，但突然之间加入如此之多的黑科技，实为少见。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">在今年第二季度，华为首次单季度超越苹果之后，华为超越苹果和三星的步伐似乎在加快。在2018年上半年业绩沟通会上，余承东再次霸气的表示：“我的团队无论做什么领域，都要成为该领域的王者。”</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">华为到了厚积薄发的时候。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">所谓的厚积薄发是华为持续在研发创新方面的投入。2017年度，中国企业研发投入前15强中，华为以103.63亿欧元的研发投入名列榜首。创始人任正非撰文“为祖国百年科技振兴而努力奋斗”中透露，华为每年的研发投入中，70%用于产品开发，20%~30%用于研究和创新，且未来几年华为的研发投入要保持在100~200亿美元之间。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">仅仅一个季度超越苹果显然不能满足余承东的野心，他希望华为成为全球第一，而且全球市场份额要占到30%以上。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; white-space: normal; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">华为Mate20系列的大革新，可以说是打下了坚实的一役。</span></p><p><span class=\"bjh-p\"><br/></span></p><p><br/></p>', '0', '0', null, '1539868741', null, '0', null, '0', null, null, null, '8');
