INSERT INTO `db_commodity` VALUES ('1', '0', '131', null, null, '云站通增强版', '/Uploads/2015-07-29/55b837b28336d.jpg', '4800.00', '4800.00', '4800.00', '云站通是由专业的IT服务提供商成都多享科技有限公司打造的一站式网络营销平台。', '     云站通是由专业的IT服务提供商成都多享科技有限公司打造的一站式网络营销平台，向客户提供全新的网络营销推广服务，服务项目包括：营销型网站制作与维护、SEM搜索引擎营销、EC在线客服、400电话、电子地图标注、网站多媒体。具有良好的搜索引擎表现和用户体验、完备的效果评估体系，能够有机利用多种手段将访客转化为顾客，将产品快速推向市场！', '0', '0.00', '0', '1', '0', '0', '7', '1438136327', '1438142651', '1', '1', '1', '云站通增强版', '云站通增强版', '云站通增强版', '0');
INSERT INTO `db_commodity` VALUES ('4', '0', '154', null, null, '多享代金券', '/Uploads/2015-07-29/55b88694cd77a.jpg', '500.00', '1000.00', '0.00', '7月特惠，凡访问多享Mall，并注册会员的用户，可免费获得500现金抵用卷一张', '<p>\r\n	·-本券仅限于办理多享科技各项业务使用。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	·-本券凭会员订单使用。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	·-消费满4000RMB情况下即可使用本券抵扣。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	·-本券最终解释权归本公司所有。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '0', '0.00', '0', '1', '0', '8', '61', '1438155579', '1439178410', '0', '1', '1', '', '', '', '0');
INSERT INTO `db_commodity` VALUES ('5', '0', '132', null, null, '海商网黄金版', '/Uploads/2015-09-17/55fa230ed68df.jpg', '10600.00', '9800.00', '0.00', '海商网内贸黄金版，7月限时活动，买1年送1年', '<p>\r\n	产品服务项目：\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	1、1个国际顶级域名，可选.com或者.net\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	2、国外服务器，网站即刻上线\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	3、78套网站风格，任意选择\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	4、独立官网，包含综合首页、单页设计、图文系统、文章系统、招聘系统、留言系统、电子地图等，功能强大全面\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	5、整站设计：选定网站风格，根据风格进行页面的排版；根据网站的功能要求进行栏目划分；设置新闻类别，发布20条以内的新闻信息；根据客户的要求分配其公司产品对应的类别；根据客户提供的资料添加100个以内的产品信息。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	6、100个产品内容及关键词的添加、修改、删除\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	7、400个产品及服务容量\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	8、在线客服，网站访问实时监控，可随时发起交谈,流量统计等\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	9、400电话，首次赠送2400分钟通话时间\r\n</p>', '0', '0.00', '0', '1', '0', '0', '0', '1438157667', '1442456336', '0', '1', '1', '', '', '', '0');
INSERT INTO `db_commodity` VALUES ('72', '0', '143', null, null, '手机网站定制', '/Uploads/2015-09-17/55fa8fc28ceb1.jpg', '5000.00', '2000.00', '0.00', '秉承建网站，重推广的理念，不仅考虑网站的设计美观，还重视网站的优化推广。尤其在网站制作设计上，有一套完整的网站建设流程。', '<div style=\"text-align:center;\">\r\n	<img src=\"/Public/Plugin/kindeditor/attached/image/20150917/20150917180337_99148.jpg\" alt=\"\" /><br />\r\n</div>', '0', '0.00', '0', '1', '0', '0', '0', '1442484219', '1442485729', '0', '0', '1', '', '', '', '0');
