; padding: 0px; box-sizing: border-box;\">致各位亲：</p></section></section></section><section class=\"Powered-by-XIUMI V5\" style=\"box-sizing: border-box;\" powered-by=\"xiumi.us\"><section class=\"\" style=\"position: static; box-sizing: border-box;\"><section class=\"\" style=\"box-sizing: border-box;\"><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; box-sizing: border-box;\"><br style=\"box-sizing: border-box;\"/></p></section></section></section><section class=\"Powered-by-XIUMI V5\" style=\"position: static; box-sizing: border-box;\" powered-by=\"xiumi.us\"><section class=\"\" style=\"margin-top: 10px; margin-bottom: 10px; line-height: 1; position: static; box-sizing: border-box;\"><section class=\"\" style=\"display: inline-block; vertical-align: top; box-sizing: border-box;\"><span style=\"width: 0px; display: inline-block; opacity: 0.6; border-left-width: 0.6em; border-left-style: solid; border-left-color: rgb(249, 110, 87); border-top-width: 0.5em !important; border-top-style: solid !important; border-top-color: transparent !important; border-bottom-width: 0.5em !important; border-bottom-style: solid !important; border-bottom-color: transparent !important; box-sizing: border-box;\"> </span><span style=\"width: 0px; display: inline-block; border-left-width: 0.6em; border-left-style: solid; border-left-color: rgb(249, 110, 87); border-top-width: 0.5em !important; border-top-style: solid !important; border-top-color: transparent !important; border-bottom-width: 0.5em !important; border-bottom-style: solid !important; border-bottom-color: transparent !important; box-sizing: border-box;\"> </span> </section><section class=\"\" style=\"display: inline-block; vertical-align: top; line-height: 1.2; padding-left: 3px; color: rgb(71, 193, 168); box-sizing: border-box;\"><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; box-sizing: border-box;\">吃燕窝注意事项<br style=\"box-sizing: border-box;\"/></p></section></section></section><section class=\"Powered-by-XIUMI V5\" powered-by=\"xiumi.us\" style=\"box-sizing: border-box;\"><section class=\"\" style=\"position: static; box-sizing: border-box;\"><section class=\"\" style=\"box-sizing: border-box;\"><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; box-sizing: border-box;\"><br style=\"box-sizing: border-box;\"/></p></section></section></section><section class=\"Powered-by-XIUMI V5\" style=\"box-sizing: border-box;\" powered-by=\"xiumi.us\"><section class=\"\" style=\"position: static; box-sizing: border-box;\"><section class=\"\" style=\"color: rgb(255, 129, 36); box-sizing: border-box;\"><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; box-sizing: border-box;\"><span style=\"font-size: 18px;\">1：燕窝性平属水，可以和各种食物相配，没有和燕窝起不良反应的食物。不过燕窝配食讲究“以清配清，以柔配柔。”一般食用燕窝期间少吃辛辣油腻食物，同时，因为燕窝含有较多的蛋白质，因此在吃燕窝的时候，也要少吃酸性的东西，至少要避免同时吃。&nbsp;</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; box-sizing: border-box;\"><br style=\"box-sizing: border-box;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; box-sizing: border-box;\"><span style=\"font-size: 18px;\">2：感冒发烧的时候，人体对燕窝营养吸收能力差，如果担心浪费，这个时候可以不吃燕窝。 &nbsp;</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; box-sizing: border-box;\"><br style=\"box-sizing: border-box;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; box-sizing: border-box;\"><span style=\"font-size: 18px;\">3：在服用其它药物的时候，不管是中西药，期间都可以吃燕窝，只是要避免同时吃，所以一般要隔开一两个小时。但请遵医嘱。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; box-sizing: border-box;\"><br style=\"box-sizing: border-box;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; box-sizing: border-box;\"><span style=\"font-size: 18px;\">4：因为茶叶里面含有茶酸，会破坏燕窝的营养，最好就隔开1小时再喝。&nbsp;</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; box-sizing: border-box;\"><br style=\"box-sizing: border-box;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; box-sizing: border-box;\"><span style=\"font-size: 18px;\">5：不满4月的新生儿不能吃燕窝，因为他们消化系统发育还不够完全，吃燕窝可能会导致消化不良。4月以后就可以食用，炖的时间稍长一点的燕窝粥孩子吃了可增加体质和食欲，促进身体和智力的生长发育。&nbsp;</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; box-sizing: border-box;\"><br style=\"box-sizing: border-box;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; box-sizing: border-box;\"><span style=\"font-size: 18px;\">6：术前或者术后吃燕窝可以帮助康复，恢复元气。但是对于肿瘤患者或者尚未治疗的病人，吃燕窝犹如抱薪救火，反而有害。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; box-sizing: border-box;\"><br style=\"box-sizing: border-box;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; box-sizing: border-box;\"><span style=\"font-size: 18px;\">7：对蛋白质类食品过敏的朋友，比如说吃鸡蛋会过敏的，可以从小量吃起，每次1克，两天一次，再慢慢增加量。&nbsp;</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; box-sizing: border-box;\"><br style=\"box-sizing: border-box;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; box-sizing: border-box;\"><span style=\"font-size: 18px;\">8：对于服用阿斯匹林过敏的朋友，建议不要吃燕窝。&nbsp;</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; box-sizing: border-box;\"><br style=\"box-sizing: border-box;\"/></p></section></section></section></section><p><span style=\"color: rgb(255, 0, 0); font-size: 18px;\"><strong><br/></strong></span></p><p><br/></p>', '1', '0.00', '88', '1', '12', '0', '722', '1481786219', '1494241731', '1000', '0', '0', '马来西亚进口燕窝-干燕窝礼盒', '进口燕窝', '进口燕窝', '1481731200');
