\">5：不满4月的新生儿不能吃燕窝，因为他们消化系统发育还不够完全，吃燕窝可能会导致消化不良。4月以后就可以食用，炖的时间稍长一点的燕窝粥孩子吃了可增加体质和食欲，促进身体和智力的生长发育。&nbsp;</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; box-sizing: border-box;\"><br style=\"box-sizing: border-box;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; box-sizing: border-box;\"><span style=\"font-size: 18px;\">6：术前或者术后吃燕窝可以帮助康复，恢复元气。但是对于肿瘤患者或者尚未治疗的病人，吃燕窝犹如抱薪救火，反而有害。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; box-sizing: border-box;\"><br style=\"box-sizing: border-box;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; box-sizing: border-box;\"><span style=\"font-size: 18px;\">7：对蛋白质类食品过敏的朋友，比如说吃鸡蛋会过敏的，可以从小量吃起，每次1克，两天一次，再慢慢增加量。&nbsp;</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; box-sizing: border-box;\"><br style=\"box-sizing: border-box;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; box-sizing: border-box;\"><span style=\"font-size: 18px;\">8：对于服用阿斯匹林过敏的朋友，建议不要吃燕窝。&nbsp;</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; box-sizing: border-box;\"><br style=\"box-sizing: border-box;\"/></p></section></section></section></section><p><br/></p>', '1', '0.00', '100', '1', '0', '0', '243', '1481788096', '1494241908', '1001', '0', '0', '马来西亚进口燕窝-头期燕盏', '马来西亚进口燕窝', '马来西亚进口燕窝', '1481731200');
