INSERT INTO `db_commodity_comment` VALUES ('16', '61', '205', '183', '3', '', '买来给宝宝用的，确实很错，没有味道，而且纸也很柔软很舒服！', '1484206043', '0', '0');
INSERT INTO `db_commodity_comment` VALUES ('17', '61', '210', '183', '3', '', '物流很给力，两天就到了！纸巾也很好是三层的，无灰尘，柔软很亲肤！', '1484365783', '0', '0');
INSERT INTO `db_commodity_comment` VALUES ('18', '254', '209', '183', '3', '', '下单很快就收到了，质量好，支持本色纸巾，更环保，安全！', '1484366867', '0', '0');
INSERT INTO `db_commodity_comment` VALUES ('19', '267', '206', '183', '3', '', '纸巾不错，挺柔软的，买来宝宝用，都说本色纸好', '1484890385', '0', '0');
INSERT INTO `db_commodity_comment` VALUES ('20', '71', '204', '183', '3', '', '纸质非常好。好评，好评。没买的亲赶紧下手。非常值得入手。', '1485070783', '0', '0');
