INSERT INTO `db_commodity_comment` VALUES ('22', '181', '160', '179', '3', 'Uploads/comments/2017-02-06/58980f86cffa3.JPG|Uploads/comments/2017-02-06/58980f8718df3.JPG', '宝贝质量好，熬制出来很丝滑口感很好！', '1486360455', '0', '0');
INSERT INTO `db_commodity_comment` VALUES ('23', '305', '224', '183', '3', '', '姐姐推荐的本色纸，昨天到了 ，今天开了一包来试，首感[机智]软，感觉比我买的心心相印的纸张还要柔软些，最主要还是安全，放心，不用担心啥漂白剂之类的呀[嘿哈]，以后就是宝宝专用款了[耶]', '1486718373', '0', '0');
INSERT INTO `db_commodity_comment` VALUES ('24', '107', '222', '160', '3', '', '不错，比较划算。下次再来。。。', '1488181896', '0', '0');
INSERT INTO `db_commodity_comment` VALUES ('25', '61', '252', '170', '3', '', '物流很快，两天就到了！平时气血不好，有些便秘，买来调节下！今天开瓶取蜂蜜调水喝的，味道很好浓浓的蜂蜜和枸杞的味道，看来厂家是费了很多原材料的！下次还光顾！', '1488358846', '0', '0');
INSERT INTO `db_commodity_comment` VALUES ('26', '61', '251', '182', '3', '', '给物流一个好评，速度超快！开箱后有6封，真是太划算了，纸巾质量也是如商家描述的好！真正的本色纸巾', '1488359042', '0', '0');
INSERT INTO `db_commodity_comment` VALUES ('27', '73', '185', '159', '3', '', '不错的选择，喝的感觉就是不错，谢谢。下次多买点有优惠不？', '1488865881', '0', '0');
