INSERT INTO `db_member_news` VALUES ('21', '欢迎光临多享互联网立体化营销沙龙', '/Uploads/2015-09-18/55fba4065d3db.jpg', '<p>\r\n	<span style=\"font-size:18px;line-height:2;color:#E53333;font-family:\'Microsoft YaHei\';\"><strong>您的到来，</strong></span><span style=\"font-size:14px;line-height:1.5;color:#E53333;font-family:\'Microsoft YaHei\';\"><strong><span style=\"font-size:18px;line-height:2;\">让多享蓬荜生辉；</span><br />\r\n</strong></span><span style=\"color:#E53333;font-size:14px;font-family:\'Microsoft YaHei\';\"><strong><span style=\"font-size:18px;line-height:2;\">您的到来，让我们倍感荣幸；</span><br />\r\n</strong></span><span style=\"color:#E53333;font-size:14px;font-family:\'Microsoft YaHei\';\"><strong><span style=\"font-size:18px;line-height:2;\">同时我们也会付出百分百的努力；</span><br />\r\n</strong></span><span style=\"color:#E53333;font-size:14px;font-family:\'Microsoft YaHei\';\"><strong><span style=\"font-size:18px;line-height:2;\">让您惊喜连连，收获满满。</span><br />\r\n</strong></span><span style=\"color:#E53333;font-size:18px;font-family:\'Microsoft YaHei\';line-height:2;\"><strong>多享全体成员恭候您的大驾光临!</strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#E53333;font-size:18px;font-family:\'Microsoft YaHei\';\"><strong><br />\r\n</strong></span> \r\n</p>', '1', '1442554672', '1', '0');
